const Statistics = ({ good, neutral, bad, total, positiveFeedback }) => {
    console.log({ good })
    return (
        <div className="statistic__list">
            <ul>
                <li>Good: {good}</li>
                <li>Neutral: {neutral}</li>
                <li>Bad:{bad}</li>
                <li>Total:{total}</li>
                <li>Positive feedback: {positiveFeedback}%</li>
            </ul>
        </div>
    )
}

export default Statistics;
